description:
Tokers In Space - Shady [Prod. Backspacez]
Released April 28, 2013.
Free download

Tokers in Space is an independent hip hop group located in Long Island, New York. It is made up of producer Backspacez and rapper Toker P. We love boom bap hip hop and weed. We love making music and sharing it with the world for free! Please give this track a listen, if you like it, pass it on to a friend! Thanks for your support.



